import React, { createContext, useState, useContext, useEffect, ReactNode } from 'react';
import { toast } from 'react-toastify';
import axios from 'axios';

interface User {
  id: string;
  name: string;
  email: string;
  credits: number;
  apiKey: string;
  apiUrl: string;
  isRecharged: boolean;
  newCredentials?: boolean;
}

interface AuthContextType {
  user: User | null;
  loading: boolean;
  error: string | null;
  isAuthenticated: boolean;
  login: (token: string) => void;
  logout: () => void;
  refreshUser: () => void;
  refreshCredits: () => void;
  acknowledgeNewCredentials: () => void;
}

const AuthContext = createContext<AuthContextType | undefined>(undefined);

export const useAuth = () => {
  const context = useContext(AuthContext);
  if (context === undefined) {
    throw new Error('useAuth must be used within an AuthProvider');
  }
  return context;
};

interface AuthProviderProps {
  children: ReactNode;
}

export const AuthProvider: React.FC<AuthProviderProps> = ({ children }) => {
  const [user, setUser] = useState<User | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    // Check if user is logged in from localStorage
    const token = localStorage.getItem('token');
    const userData = localStorage.getItem('user');
    
    if (token && userData) {
      try {
        setUser(JSON.parse(userData));
      } catch (error) {
        console.error('Failed to parse user data:', error);
        localStorage.removeItem('token');
        localStorage.removeItem('user');
      }
    }
    
    setLoading(false);
  }, []);

  // Send API credentials to user's email
  const sendCredentialsEmail = async (userEmail: string, apiKey: string, apiUrl: string) => {
    try {
      // In a real app, this would be an API call to your backend
      // For this demo, we'll simulate success after a delay
      toast.info(`Sending credentials to ${userEmail}...`);
      
      // Simulate API call with delay
      await new Promise(resolve => setTimeout(resolve, 1500));
      
      // Simulate success
      toast.success(`API credentials sent to ${userEmail}`);
      console.log(`Credentials email sent to: ${userEmail}`);
      console.log(`API URL: ${apiUrl}`);
      console.log(`API Key: ${apiKey}`);
      console.log(`Initial Credits: 4`);
      
      // In a real implementation, you would have a backend API like:
      /*
      await axios.post('/api/send-credentials', {
        email: userEmail,
        apiKey: apiKey,
        apiUrl: apiUrl,
        credits: 4
      });
      */
    } catch (error) {
      console.error('Failed to send credentials email:', error);
      toast.error('Failed to send credentials email. Please check your dashboard for API details.');
    }
  };

  const login = (token: string) => {
    try {
      // Decode the Google JWT token to get user info
      // JWT tokens are in format: header.payload.signature
      const payload = token.split('.')[1];
      const decodedPayload = JSON.parse(atob(payload));
      
      // Generate a unique API key
      const uniqueApiKey = `key_${Math.random().toString(36).substring(2, 15)}_${Math.random().toString(36).substring(2, 15)}`;
      const apiUrl = `${window.location.origin}/api`;
      
      // Extract user information from the token
      const userData: User = {
        id: decodedPayload.sub,
        name: decodedPayload.name || decodedPayload.email.split('@')[0],
        email: decodedPayload.email,
        credits: 4, // Start with 4 credits
        apiKey: uniqueApiKey,
        apiUrl: apiUrl,
        isRecharged: false,
        newCredentials: true // Flag to indicate new credentials are available
      };

      // Save user data
      localStorage.setItem('token', token);
      localStorage.setItem('user', JSON.stringify(userData));
      setUser(userData);
      
      // Send welcome email with API credentials
      sendCredentialsEmail(userData.email, uniqueApiKey, apiUrl);
      
      toast.success('Logged in successfully!');
    } catch (error) {
      console.error('Error parsing JWT token:', error);
      // Fallback to mock data if token parsing fails
      const mockUserData: User = {
        id: '123456',
        name: 'Test User',
        email: 'test@example.com',
        credits: 4,
        apiKey: 'sample-api-key-for-testing',
        apiUrl: `${window.location.origin}/api`,
        isRecharged: false,
        newCredentials: true // Flag to indicate new credentials are available
      };

      localStorage.setItem('token', token);
      localStorage.setItem('user', JSON.stringify(mockUserData));
      setUser(mockUserData);
      toast.success('Logged in successfully!');
    }
  };

  const logout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setUser(null);
    toast.info('Logged out successfully');
  };

  const refreshUser = () => {
    // Mock implementation - in a real app this would fetch updated user data
    if (user) {
      const updatedUser = { ...user };
      setUser(updatedUser);
    }
  };

  const refreshCredits = () => {
    // Mock implementation - in a real app this would refresh credits count
    if (user) {
      const updatedUser = { ...user, credits: 100 };
      localStorage.setItem('user', JSON.stringify(updatedUser));
      setUser(updatedUser);
      toast.success('Credits refreshed successfully!');
    }
  };

  const acknowledgeNewCredentials = () => {
    if (user && user.newCredentials) {
      const updatedUser = { ...user, newCredentials: false };
      localStorage.setItem('user', JSON.stringify(updatedUser));
      setUser(updatedUser);
    }
  };

  return (
    <AuthContext.Provider value={{ 
      user, 
      loading,
      error,
      isAuthenticated: !!user, 
      login, 
      logout,
      refreshUser,
      refreshCredits,
      acknowledgeNewCredentials
    }}>
      {children}
    </AuthContext.Provider>
  );
};

export default AuthContext;
